const pagesKey='page';

let pageJson=localStorage.getItem(pagesKey);
let pagesStore=JSON.parse(pageJson);


export default{
    getAllPAges(){
        return pagesStore;

    },
    getSinglePage(index){
        return pagesStore[index];
    }

}
